import Link from 'next/link';

let NavigationLink = (props) => {
	let navLinks = props.linkList.map((lk, index) => (
			<Link href={lk.link} key={index}>
				<a className={props.classList || ""}> {lk.name} </a>
			</Link>
		))

	return (
		{navLinks}
	);
}

export default NavigationLink;
